const Users= () =>
{
    const [users,setUsers]= useState([{
        name:"lony", email:"dxc", gender:"f", status:"a"
    },{
        name:"lony", email:"pxc", gender:"m", status:"a"
    },{
        name:"lony", email:"dc", gender:"f", status:"ia"
    } ])
    return (

        <div>
            {users.map((user) => (
                <User key={user.name} userData={user}/> 
            ))}
        </div>
    )
}
export default Users;
